import React from "react";
import ContactData from "./ContactData";
import ContactInfoContent from "./ContactInfoContent";
const ContactInfo = () => {
  return (
    <div>
      {ContactData.map((data) => (
        <ContactInfoContent key={data.id} data={data} />
      ))}
    </div>
  );
};

export default ContactInfo;
